 import React from 'react';
 import logo from './logo.svg';
 import mock1 from './assets/mock1.jpg'
 import  { Toolbar, AppBar } from '@material-ui/core';
 import {Container, Row, Col} from 'react-grid-system';
 import './App.css';
import Grid from './components/grid';


function Body() {
  return (
    <React.Fragment>
      <div className="Body">
      <div className={["Header", "Title"].join(" ")}>Taiyaki</div>
      <div className={["Desc", "Roboto"].join(" ")}>Watch and sync your anime</div>
      </div>
    </React.Fragment>
  );
}

function LogoView() {
  return (
    <React.Fragment>
      <div className="Logo-view">
        <img src={logo} className="Logo" alt="logo"/>
        <Body/>
      </div>
    </React.Fragment>
  );
}

function Image() {
  return (
    <div>
    <img src={mock1} className="mock1" alt="mock"/>
  </div>
  );
}




function App() {
  return (
   <React.Fragment>
   <div className="App">
   <header className="App-header">
   <AppBar position="fixed">
     <Toolbar className="Tool-bar">{
       <h1 className={["Header", "Roboto"].join(" ")}>Taiyaki</h1>
     }</Toolbar>
   </AppBar>
   </header>
   <LogoView/>
   <Image/>
   <Container>
    <Row align="center" className="Row">
     <Grid key={"1"}/>
     <Grid key={"2"}/>
     <Grid key={"3"}/>
    </Row>
   </Container>
   </div>
   </React.Fragment>
  )
}

export default App;

